import { React, useState, useEffect } from "react";
import { useParams } from "react-router-dom";
const Materijal = () => {
  let { id } = useParams();
  const [data, setData] = useState([]);

  useEffect(async () => {
    axios
      .get(`http://localhost:5000/kategorije/${id}`)
      .then((res) => {
        console.log(res.data);
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div>
      <h1>ID: {id}</h1>
    </div>
  );
};

export default Materijal;
